<script>
// import hello from '../../hello.json'
import infoModal from '../components/infoModal.vue'
// import preloader from '@/components/preloader.vue'
// import { mapState } from 'pinia'
// import { useStore } from '@/store'
export default {
  name: 'schema-block',
  data() {
    return {
      timer: 4000,
      fetchData: [],
      meter_list: ['124200568810','124200582873','124200564411','124200564414','124200564413','124200564412','124200568736','124200564415','124200568735','124200564410'],
      settimer: false,
      time: null,
      modal: false,
      interval: null,
      number_meter: null,
      parameters: null
    };
  },
  components:{
    infoModal,
    // preloader,
  },
  methods: {
    dateformat(e){
      if(e){
        e.split('-')[0]
      }
    },
    async openModal(i){
      if(i){
        this.number_meter = i._id
        // this.$store.info = i
      }else{
        this.number_meter = null
      }
      this.modal = !this.modal
    },
    async mountfunc(){
      clearTimeout(this.interval)
      clearTimeout(this.time)
      this.settimer = false
      await this.$axios.get('/mnemo-schema/all').then((res)=>{
        let response = res?.data?.data
        response = response.filter((el)=>(((this.meter_list?.includes(el?.number_meter)))))
        this.fetchData = response
        const t = this
        if(res.headers['request-duration'] > this.timer){
          t.settimer = true
        }else{
          this.time = setTimeout(() => {
            t.settimer = true
          }, this.timer);
        }
        t.time = setTimeout(() => {
          t.lastdata()
        }, this.timer);
      }).catch(async (err)=>{
        const statusCode = (err.response || {}).status || -1;
        if(statusCode != 406){
          const t = this
          this.settimer = true
          clearTimeout(this.interval)
          t.interval = setTimeout(() => {
            t.lastdata()
          }, this.timer);
        }else{
          if(err.config.method == 'get'){
            await this.$axios.post('refresh_token','',{headers:{refresh:localStorage.getItem('refresh')}}).then(async (res)=>{
              localStorage.setItem('session',res?.data?.session)
              await this.mountfunc()
            })
          }
        }
      })
    },
    async lastdata(){
      await this.$axios.get('/mnemo-schema/all').then((res)=>{
        let response = res?.data?.data
        response = response.filter((el)=>(((this.meter_list?.includes(el?.number_meter)))))
        this.fetchData = response
        const t = this
        clearTimeout(this.interval)
        t.interval = setTimeout(() => {
          t.lastdata()
        }, this.timer);
      }).catch(async (err)=>{
        const statusCode = (err.response || {}).status || -1;
        if(statusCode != 406){
          const t = this
          this.settimer = true
          clearTimeout(this.interval)
          t.interval = setTimeout(() => {
            t.lastdata()
          }, this.timer);
        }else{
          if(err.config.method == 'get'){
            await this.$axios.post('refresh_token','',{headers:{refresh:localStorage.getItem('refresh')}}).then(async (res)=>{
              localStorage.setItem('session',res?.data?.session)
              await this.lastdata()
            })
          }
        }
      })
    }
  },
  computed: {
    // ...mapState(useStore, ['activeSvg','fetchData'])
  },
  async mounted() {
    this.mountfunc()
  },
};
</script>
